import React from 'react';

function Color(props) {
  const colorType = props.colorType;
  const hex = props.colorNames.hex.toString();
  var colorName;
  var classes = "color-name";
  if (colorType == "HEX") {
    colorName = hex;
  } else if (colorType == "RGB") {
    colorName = <span style="color:blue">{props.colorNames.rgb}</span>;
    classes += " rgb"
  }
  return (
    <>
    <div className="color-item">
    <div className="color-chip" style={{backgroundColor:hex}}
    onClick={props.function}>
    </div>
      <p className={classes}>{colorName.r}</p>
    </div>
    </>
  )
}
  export { Color };
